package com.fp.pi.review;

public class HeartDTO2 {
	private int h_no;
	private int h_c2_no;
	private String h_m_email;
	
	public HeartDTO2() {
		// TODO Auto-generated constructor stub
	}

	public HeartDTO2(int h_no, int h_c2_no, String h_m_email) {
		super();
		this.h_no = h_no;
		this.h_c2_no = h_c2_no;
		this.h_m_email = h_m_email;
	}

	public int getH_no() {
		return h_no;
	}

	public void setH_no(int h_no) {
		this.h_no = h_no;
	}

	public int getH_c2_no() {
		return h_c2_no;
	}

	public void setH_c2_no(int h_c2_no) {
		this.h_c2_no = h_c2_no;
	}

	public String getH_m_email() {
		return h_m_email;
	}

	public void setH_m_email(String h_m_email) {
		this.h_m_email = h_m_email;
	}
	
	
	
	
}
